import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCloud } from '@fortawesome/free-solid-svg-icons';
import { faMusic } from '@fortawesome/free-solid-svg-icons';
import { faCalendar } from '@fortawesome/free-solid-svg-icons';
import { faGear } from '@fortawesome/free-solid-svg-icons';
import { faDesktop } from '@fortawesome/free-solid-svg-icons';
import { faTimes } from '@fortawesome/free-solid-svg-icons';

const close_menu = () => {
    $("#menu").removeClass("active");
    $("#close").hide();
    $("#footer").show();
}

const Menu = () => {
    return(
        <div id="menu">
            <div id="close"><FontAwesomeIcon icon={ faTimes } size="3x" onClick={this.close_menu} /></div>
            <li style={{"--i" : 0}}>
                <div><FontAwesomeIcon icon={ faCloud } size="2x"/></div>
            </li>
            <li style={{"--i" : 1}}>
                <div><FontAwesomeIcon icon={ faMusic } size="2x"/></div>
            </li>
            <li style={{"--i" : 2}}>
                <div><FontAwesomeIcon icon={ faCalendar } size="2x"/></div>
            </li>
            <li style={{"--i" : 3}}>
                <div><FontAwesomeIcon icon={ faGear } size="2x"/></div>
            </li>
            <li style={{"--i" : 4}}>
                <div><FontAwesomeIcon icon={ faDesktop } size="2x"/></div>
            </li>
        </div>
    )
};

export default Menu;
